/*Table structure for table `reportinfo` */

DROP TABLE IF EXISTS `reportinfo`;

CREATE TABLE `reportinfo` (
  `id` varchar(100) NOT NULL COMMENT '举报信息id标识',
  `releaseId` varchar(100) NOT NULL COMMENT '发布信息id',
  `personalId` varchar(100) NOT NULL COMMENT '个人资料Id',
  `reportTypeId` varchar(100) NOT NULL COMMENT '举报类型id',
  `imageArray` varchar(255) DEFAULT NULL COMMENT '图片数组',
  `remark` varchar(255) DEFAULT NULL COMMENT '举报备注',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT NULL COMMENT '创建人',
  `uman` varchar(32) DEFAULT NULL COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `reportinfo` */

LOCK TABLES `reportinfo` WRITE;

UNLOCK TABLES;

/*Table structure for table `reporttype` */

DROP TABLE IF EXISTS `reporttype`;

CREATE TABLE `reporttype` (
  `id` varchar(32) NOT NULL COMMENT '举报类型id标识',
  `reportTitle` varchar(100) NOT NULL COMMENT '举报标题',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT NULL COMMENT '创建人',
  `uman` varchar(32) DEFAULT NULL COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `reporttype` */

LOCK TABLES `reporttype` WRITE;

